import React from 'react'
import styled from "styled-components"

const Header = () => {

const HeaderWrapper = styled.header`
    width: 100vw;
    height: 4rem;
    background-color: black;
    color: white;
`
const HeaderContainer = styled.div`
    width: 100%;
    height: 100%;

`

  return (
    <HeaderWrapper>
        <HeaderContainer>
            <div></div>
            <div></div>
        </HeaderContainer>
    </HeaderWrapper>
  )
}

export default Header
